import { Routes, Route, Navigate } from "react-router-dom";

const token = localStorage.getItem("token");

function App() {
  return (<Routes>
      <Route path="/login" element={<Login />} />
      <Route
        path="/dashboard"
        element={token ? <Dashboard /> : <Navigate to="/login" />}
      />
      <Route path="*" element={<Navigate to="/login" />} />
